013-11-29 08:08:46',29,NULL),(156,'Efterbetaling RBNS','Efterbetaling udregnes som forskellen mellem gldende fra og registreringsdatoen (tidsintervallet). Efterbetaling er ydelsen pr mned * tidsintervallet. Hvis der ingen dato er lgges en given system parameter tidsinterval til. Afventer diskurs om gldende fra.',NULL,'feature','unscheduled',NULL,5,NULL,4,'2013-09-11 13:00:25','2013-11-26 14:50:39',18,'kontor'),(157,'En RBNS pr dag','Det skal kun vre muligt at oprettes n hensttelse pr dato. Det skal gives en advarsel til brugeren herom. Pt er det muligt at lave 7 ens hensttelse p samme dag.',1,'feature','delivered',NULL,5,7,4,'2013-09-11 13:02:10','2013-11-29 08:09:29',29,NULL),(158,'RBNS: Overgangsbelb enke','Nr enker for tilkendt en erstatning er det for en periode og et kontant belb (overgangsbelb ved ddsfald). Dette overgangsbelb er reguleret af  ASK. Ulykkesdato er bestemende for belbets strrelse. Fx Hvis ddsfaldet sker i januar 2012 s er det 2012 belbet som er gldende.\nNr man opretter en RBNS p en FTE skal man tillige kunne angive om der skal hensttes til et overgangsbelb. Hvis det er tilfldet findes belbet som beskrevet ovenfor.',2,'feature','accepted','2013-11-28',5,5,4,'2013-09-11 13:03:19','2013-11-28 11:12:07',37,NULL),(159,'Liste: rbns pr. dato reberegnet','Rbns beregning ifht pr datoen. Den laves som ny rapport \'Rbns reberegnet pr dato\' med samme indhold som \'Rbns pr dato\'. Her reberegnes alle Rbns\'er til denne dato + 1 dag. Rbns\'erne m ikke gemme sit indhold.',1,'feature','delivered',NULL,5,7,4,'2013-09-11 13:04:41','2013-12-06 07:36:24',32,NULL),(160,'Hjlpeadresser','Under menuen stamdata oprettes en fane hvori man kan redigere hjlpeadresser. Disse adresser migreres fra hjadr tabellen.Den skal indeholde navn, 4 adresselinie, email, rederi-id. Navn vises i gui og hentes fra rederi tabellen.\nRederi-id verfificeres imod rederi tabellen.\nCheck lige #92 som nu skal hente reders email adresse herfra istedet.',3,'feature','delivered',NULL,5,7,4,'2013